import { format } from 'date-fns'

const VagasIndiv = ({ vaga }) => (
    <div>
        <div><img src="https://via.placeholder.com/50" alt="" /></div>
        <p>{format(new Date(vaga.data_pub), 'dd-MM-yyyy')}</p>
        <h1>{vaga.cargo}</h1>
        <span>{vaga.localidade}</span>
    </div>
);

export default VagasIndiv
